import React, {Fragment} from "react";

import { Helmet } from "react-helmet";

import { Col, Jumbotron } from "react-bootstrap";

const ProfilePage = () => {
  const aboutPageTitle = "About/Amirreza Ghanei";

  return (
    <Fragment>
      <Helmet>
        <title>{aboutPageTitle}</title>
      </Helmet>
      <Jumbotron fluid={true} className="mt-3 d-flex justify-content-center">
          <h2 className="text-info">Hello,</h2>
        <p>
          I am Amirreza Ghanei, from Iran, i am 25 years old and i live in
          Germany.
          <br />
          In November 2018 i started to learn Coding at Digital Career Institute
          gGmbH
          <br />
          And finally i finished the one Year Course in December 2019.
          <br />
          After i finished the Course, i started directly to Work as Assistant
          Teacher,
          <br />
          In the same Company and made a lot of greate Experience.
        </p>
        {/* <p className="mt-5">
              This is a simple hero unit, a simple jumbotron-style component for
              calling
            </p> */}
      </Jumbotron>
    </Fragment>
  );
};

export default ProfilePage;
